import React from 'react';
import gql from 'graphql-tag';
import { useQuery } from '@apollo/react-hooks';

const LOCATIONS_QUERY = gql`
  query Locations {
    locations {
      info {
        count
        pages
        next
        prev
      }
      results {
        name
        type
      }
    }
  }
`;

const Home = () => {
  const { data, loading, error } = useQuery(LOCATIONS_QUERY);

  return <div>{JSON.stringify(data)}</div>;
};

export default Home;
